import React from "react"
import "./button.css"

class Selector extends React.Component
{

    onDragMouse()
    {
        this.setState(
            {
                position: "600px"
            }
        )
        console.log("done")
    }

    constructor(props)
    {
        super(props)

        this.state ={
            position : props.position
        }

        this.onDragMouse = this.onDragMouse.bind(this);
    }


    render()
    {
        return(
        <div className = "selecting" onDrag = {this.onDragMouse} style = {{marginLeft: this.state.position}}> </div>
        );
    }


}

export default Selector;
